import React from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

const containerStyle = {
  width: '100%',
  height: '500px'
};

const center = {
  lat: 28.6139, // Default to New Delhi
  lng: 77.2090
};

function Maps() {
  return (
    <div className="p-8">
      <h2 className="text-2xl font-bold mb-4 text-green-800">Nearest E-Waste Centers</h2>
      <LoadScript googleMapsApiKey="AIzaSyAH8Mqz2Jazg0Q0tM_XA27CSgzRqS7v2Kk">
        <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={12}>
          <Marker position={center} />
          {/* Add more markers dynamically if needed */}
        </GoogleMap>
      </LoadScript>
    </div>
  );
}

export default Maps;
